import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom'

import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

function Home() {
  return (
    <h1>HOME PAGE</h1>
  );
}

function test() {
  return (
    <h1>TEST</h1>
  );
}

function Sidebar() {

    return (
        <div className="sidebar">
            <img></img>
            <ul>
                <li>
                    Browse
                </li>
                <li>
                    Search
                </li>
            </ul>
            <hr></hr>

            <ul>
              <li>lol</li>
            </ul>
        </div>
    );
}

function App() {
  return (

    <Router>
      <Switch>
        <Route path='/' exact={true} component={Sidebar}/>
        <Route path='/test' component={test}/> 
      </Switch>
    </Router>
    // <div className="App">
    //   <h1>HELL1O</h1>
    // </div>
  );
}

export default App;
